import React from 'react';
import '../App.css';
import { Col, Container, Row, Image } from 'react-bootstrap';
import SaltForkMap from '../Componets/rivers/salt-fork.jpg'
import Calendar from '../Componets/calendar/index';
import Weather from '../Componets/weather/weather';
import SelectionFrom from '../Componets/SelectionForm/SelectionForm';


export default function BookingPage({ routeSelected, value, setValue, back, booked, kayaksInStock , form}){





  //whats rendered to the DOM
  return (
      <div >
        <h1>{ routeSelected}</h1>
        booking page
        <Calendar value={value} onChange={setValue} back={back} booked={booked} kayaksInStock={kayaksInStock} form={form} />
        <Weather />
        <SelectionFrom 
            route={routeSelected}
            value={value}
            // kayaks={booked[0].bookings}
            // showHome={showHomeHandler}
            kayaksInStock={kayakStock}
            // back={showCalendar}
            showStore={showingStore}
            storePath={storePath}
        />
      </div>
  )
}
